import React from 'react';
import { Link } from 'react-router-dom'
import Title from './Title';
import {withProvider} from './AppContext'

const Main = (props) => {
    return (
        <div>
        <Link to='/PongSelect'><button  className='btn btn-lg btn-muted btn-block' type="submit">OG PONG</button></Link>
        <Link to='/InvisiSelect'><button className='btn btn-lg btn-muted btn-block' type="submit"><Title /></button></Link>
        <Link to='/' onClick={props.logout}><button className='btn btn-lg btn-dark btn-block' type="submit">Logout</button></Link>
        </div>
    )
}

export default withProvider(Main);
